      name: 'Hello Kitty',
      avatarUrl: 'https://placekitten.com/g/64/64',
    },
  };

export default class ProjectDetail extends React.Component{
    constructor(props) {
        super(props);
      }
      render(){
          return(
              <div></div>
          );
      }
}
